const routes: Routes =[

  {path:'', component:CheckoutComponent },
  {path:'success', component:SuccessComponent },
]


@NgModule({
  declarations: [],
  imports: [
    RouterModule.forChild(routes)
  ],
  exports:[RouterModule]
